# 3 Optimization in a Black-Scholes market 

This section assumes that the underlying financial market follows the Black-Scholes model, i.e., the market is complete. Then, the price dynamics for the $d$ risky assets $S^{i}, i \in\{1, \ldots, d\}$ are given by

$$
\mathrm{d} S_{t}^{i}=S_{t}^{i} \mu_{t}^{i} \mathrm{~d} t+S_{t}^{i} \sigma_{t}^{i} \mathrm{~d} W_{t}
$$

where $W$ is the Brownian Motion generating the filtration $\mathcal{F}, \mu_{i}$ is the deterministic drift of the $i^{\prime}$ th asset and $\sigma^{i j}$ is the deterministic volatility between the $i^{\prime}$ th and the $j^{\prime}$ th asset. We assume that $\sigma_{t}$ is bounded, bounded away from zero and invertible. Then, there exists a unique price density process $\xi$ with the wealth process $X$ and the price density process $\xi$ admitting the following dynamics

$$
\begin{aligned}
\mathrm{d} X_{t} & =X_{t}\left[r_{t}+u_{t}^{T}\left(\mu_{t}-r\right)\right] \mathrm{d} t+X_{t} u_{t}^{T} \sigma_{t} \mathrm{~d} W_{t} \\
\mathrm{~d} \xi_{t} & =-\xi_{t} r_{t} \mathrm{~d} t-\xi_{t} \kappa_{t}^{T} \mathrm{~d} W_{t}
\end{aligned}
$$

with $X_{0}=x_{0}$ and $\xi_{0}=1$, where $\kappa_{t}=\left(\sigma_{t}\right)^{-1}\left(\mu_{t}-r_{t}\right)$ is the Sharpe ratio process and.$^{T}$ denotes the transpose of a vector. The term $\xi_{T}(\omega), \omega \in \Omega$, can be interpreted as the Arrow-Debreu value per probability unit in state $\omega$ at time $T$. Note that $\xi_{T}(\omega)$ can be written as a decreasing function of the stock price, and therefore attains high values in times of a bad economy and low values in times of a good economy. We assume that the processes $r_{t}$ and $\mu_{t}$ are integrable and the processes $\sigma_{t}$ and $\kappa_{t}$ are square-integrable over $[0, T]$ to ensure that the previous SDEs and all of the following integrals are well-defined.
